import React, { Component } from 'react';   
import {NavLink} from "react-router-dom"; 
import {Fade} from 'react-reveal';
import '../styles/Landing.css';

import logo from '../images/nextgenlogo.png';
import video from '../images/nextgenvid.mp4';

import foundations from '../images/foundations.png';
import techniques from '../images/techniques.png';

import silver from '../images/silver.png';
import gold from '../images/gold.png';

import Nav from '../components/Nav';

class Landing extends Component {

    constructor(props) {
        super(props);
        this.state = {
            changeNav: false
        }
    }

    componentDidMount() {
        window.addEventListener('scroll', this.handleScroll);
    }

    componentWillUnmount() {
        window.removeEventListener('scroll', this.handleScroll);
    }

    handleScroll = (event) => {
        var whiteDiv = document.getElementById("instructContainer");
        var diff = whiteDiv.offsetTop - window.pageYOffset;
        if (diff <= 45 ) {
            this.setState({changeNav: true});
        } else {
            this.setState({changeNav: false});
        }

        // console.log(whiteDiv.offsetTop - window.pageYOffset);
    }

    render() {
        return (
            <div>
                {this.state.changeNav? 
                    <Nav color="black"/>    
                : <Nav color="white"/> }


                <div id="intro" className="intro-container">
                    <Fade duration={2000}>
                        <img id="intro-logo" src={logo}></img>
                    </Fade>
                    <div className="half-section">
                        <Fade delay={1000}>
                            <p className="intro-text">A school seeking to lead the next generation <br/> of barbers towards success.
                            </p>
                        </Fade>
                        {/* <button className="dark-btn">Preview</button> */}
                    </div>
                    <div className="black-gradient">
                    </div>
                </div>

                <div ref={this.previewRef} className="preview-container">
                    {/* <div className="preview-text-container">
                        <Fade delay={1000}>
                            <p className="preview-txt">
                                Take a quick look at what Next Gen has to offer
                            </p>
                        </Fade>
                    </div> */}
                    <div className="video-container">
                        <div class></div>
                        <video className="preview-video noSelect" src={video} type="video/mp4" controls loop>
                        </video>
                    </div>
                    {/* <Fade delay={500}>
                        <h1 id="quote">“Our experience leads to yours.”</h1>
                    </Fade> */}
                </div>

                <div id="instructContainer" className="instructors-container">
                    <div className="instructors-window">
                        <div className="black-gradient2"></div>
                        <div className="instructors-txt-container">
                            <h1 id="instructors">Our instructors</h1>
                            <p id="instructors-desc">are passionate barbers dedicated to sharing their knowledge acquired over 10+ years of experience</p>
                        </div>

                        <div id="barber1" className="barber-container"></div>
                        <div id="barber2" className="barber-container"></div>
                        <div id="name-left" className="name-container">
                            <h4>Navarone Paul</h4>
                            <p>@WOWNVRN</p>
                        </div>
                        <div id="name-right" className="name-container">
                            <h4>Christopher Gonzales</h4>
                            <p>@CHRISGTHEBARBER</p>
                        </div>
                    </div>
                </div>

                <div className="workshops-section">
                    <h1 id="workshops">Workshops</h1>
                    <div className="booklet-container">
                        <div className="booklet-case">
                            <img src={foundations} className="book-img"></img>
                            <img src={gold} className="scissors"></img>
                            {/* <p className="booklet-desc">
                                This course seeks to teach students the basics of fading, scissor work, and beard work.
                            </p> */}
                        </div>
                        <div className="booklet-case">
                            <img src={techniques} className="book-img"></img>
                            <img src={silver} className="scissors"></img>
                            {/* <p className="booklet-desc">
                                This course seeks to teach students the basics of fading, scissor work, and beard work.
                            </p>                             */}
                            {/* <span className="booklet-sub-title">(coming soon)</span> */}
                        </div>
                    </div>
                </div>

                <div className="connect-section">
                    <h1>Connect With Us</h1>
                </div>

                <div className="footer">

                </div>

            </div>

        );
    }

}

export default Landing;
